import React, { Component } from "react";
import {
  Container,
  Col,
  Form,
  FormGroup,
  FormText,
  FormFeedback,
  Label,
  Input,
  Button
} from "reactstrap";
import { Link } from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <div>
        <h1 style="color:white;">CodeCon Issue Tracker</h1>
        <Button tag={Link} to="/login" id="signin" color="success" size="lg">
          Login
        </Button>

        <Button
          id="register"
          tag={Link}
          color="warning"
          size="lg"
          to="/register"
        >
          Register
        </Button>
      </div>
    );
  }
}
